import styled from "styled-components";

const Logo = styled.div`
	.logo-container {
		display: flex;
		flex-direction: column;
		align-items: center;
	}
	.logo-image {
		height: 100px;
		width: auto;
	}
	.logo-name {
		height: auto;
		width: 100px;
	}
`;

export default Logo;
